const Product=()=>{
    const getProductData=async()=>{

        try{
            const res= await fetch("https://fakestoreapi.com/products")
            console.log(res)

        }catch(err){
            console.log(err);

        }

    }
    useEffect(()=>{
        getProductData();
    },[])
}

const Products=() =>{
